import Vue from 'vue'
import App from './App.vue'

Vue.config.productionTip = false
/* 
 关于不同版本的Vue
 1.vue.js是完整版的vue 包含:核心功能 + 模板解析器
 2.vue.run

*/
new Vue({
  el:"#app",
  render(createElement){
    return createElement(App)
  },
})
